            //iddVari.getIddDaux().setValue("       ");
            //////////////////////////////////////////////////////////////////////////////////////////////
            logger.debug("%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%");
            logger.debug("%%%% cobol %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%");
            logger.debug("MOVE IDD-DAUX TO FIO-MEN2");
            logger.debug("%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%");

            fioCtts.getFioMens().setFioMen2(iddVari.getIddDaux().getValue());

